function Product(){
    const price=310;
    return (
        <div className='product-page-container'>
            <div className='product-page-image'>
            <img className='card-image' src={bottles} alt="bottles"/>
            </div>
            <div className='product-page-product-description'>
                <h2>Bottle</h2>
                <p>Bottle Description</p>
                <p className='product-page-price'>Price : <span>{`$ ${price}`}</span></p>
                <p>In Stock</p>
                <button className='add-to-cart-button'>Add to Cart</button>
            </div>
        </div>
    )
}
export default Product;
